import React from 'react';
import {BrowserRouter as Router, Route} from "react-router-dom";
import './App.css';
import HomePage from "./pages/HomePage";
import WatchPage from "./pages/WatchPage";
import {SocketProvider} from "./contexts/SocketProvider";

function App() {

	return(
		<SocketProvider>
			<Router>
				<switch>
					<Route exact path="/" render={()=><HomePage endpoint={this.state.endpoint} createRoomCallback={this.createRoomCallback}/>}/>
					<Route path="/watch" render={()=><WatchPage endpoint = {this.state.endpoint} game={this.state.game}/>}/>
				</switch>
			</Router>
		</SocketProvider>
	)

}

export default App;
